from typing import Callabledef logging_func(func: Callable) -> None:    def wrapper(*args, **kwargs):        result = func(*args, **kwargs)        print(f'INFO: {func.__name__} ishga tushdi va uning argumentlari {args}. Qaytgan natija esa {result}')        return result    return wrapper@logging_funcdef mult(x: int, y: int) -> int:    return x * y@logging_funcdef div(x: int, y: int) -> int:    return x // ydiv(12, 2)mult(24, 3)